import React from 'react';
import "./contact.css"


const ContactPage = () => {
    return (
        // <div className="container contact-page">
        //   <h1 className="text-center mb-4">Contact Us</h1>
        //   <div className="row">
        //     <div className="col-md-4">
        //       <div className="contact-component bg-light p-4 rounded">
        //         <h2 className="mb-3">Contact by Phone</h2>
        //         <p>Phone: (123) 456-7890</p>
        //       </div>
        //     </div>
        //     <div className="col-md-4">
        //       <div className="contact-component bg-light p-4 rounded">
        //         <h2 className="mb-3">Contact by Email</h2>
        //         <p>Email: example@example.com</p>
        //       </div>
        //     </div>
        //     <div className="col-md-4">
        //       <div className="contact-component bg-light p-4 rounded">
        //         <h2 className="mb-3">Contact by Address</h2>
        //         <p>123 Street, City, Country</p>
        //       </div>
        //     </div>
        //   </div>
        // </div>
        <>
            <div className="contact">
                <div className="left">
                    <div className="contactTilte">
                        <h1>Let's chat.</h1>
                        <h1>Tell me about your project.</h1>
                        <h1>Let's create something together.</h1>
                        <div>
                            <i class="fa-solid fa-envelope"></i>
                            <p>mail me at</p>
                            <p>email@gmail.com</p>
                        </div>
                    </div>

                </div>
                <div className="right">
                    <form className="contactForm">
                        <label>Send us a message</label>
                        <input className="contactInput" type="text" placeholder="Enter your name" name="name"></input>
                        <input className="contactInput" type="text" placeholder="Enter your email address" name="email"></input>
                        <input className="contactInput" type="text" placeholder="Subject" name="subject"></input>
                        <input className="contactInput" type="text" placeholder="Tell us more" name="description"></input>
                        <button class="contactButton" type="submit">Send Message</button>
                    </form>
                </div>
            </div>
        </>
    );
}

export default ContactPage;
